interface LeftDrawerProps {
  open: boolean;
}

export default function LeftDrawer({ open }: LeftDrawerProps) {
  return (
    <Drawer anchor="left" open={open} variant="persistent">
      <Drawer>Menu</Drawer>
    </Drawer>
  );
}
